import React from 'react';

function Awards() {
    return (
        <div className='container'>
            <div className='row'>
                <div className='col-lg-6 col-sm-12'>
                    <img src='images/largestBroker.svg' alt='Largest Broker in India' className='img-fluid' />
                </div>
                <div className='col-lg-6 col-sm-12'>
                    <h1>Largest Stock Broker in India</h1>
                    <p>2+ million ProfitProfile clients contribute to over 15% of all </p>
                    <ul>
                        <li></li>
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default Awards;
